import React from 'react';
import { useState } from 'react';

export default function Yearlyamount(props) {
  const { name, price, planType, handleStuff } = props;

  return (
    <>
      <div className="options">
        <div className="option">
          <label for="arcade1">
            <input
              type="radio"
              name={name}
              value={price}
              id={planType}
              checked
              onClick={(e) => handleStuff(e)}
            ></input>
            <h2>{name}</h2>
            <p>${price}/mo</p>

            <p>2 Months Free</p>
          </label>
        </div>
      </div>
    </>
  );
}
